Condition : 8 - Prior to commencement of development (except demolition, archaeological investigations, ground condition investigations and intrusive site surveys and other enabling works: site clearance; soil storage; remedial works in respect of any contamination or any other adverse ground conditions; erection of any temporary means of enclosure, land raising and construction of the bridge), details and samples of all facing materials to buildings are submitted to and approved in writing by the Local Planning Authority. The samples and details shall include:
a.	brick/stonework (including brick/stone and mortar on-site sample panel min. 2m x 2m);	
b.	cladding materials (including system specifications/details and on-site samples (where relevant);
c.	window treatment (including sections/reveals and on-site sample);
d.	all privacy measures, (including, where relevant, obscure glazing details - including where separation distances between habitable room windows are less than 18m - privacy screens - etc.);
e.	balustrading treatment (including  details/sections/materials for each balcony type); and
f.	any other materials/details to be used including extract vents, boiler flues, etc.
The development shall then be carried out in accordance with the approved details and maintained as such thereafter.

Condition : 14 - Prior to commencement of the development (except demolition, archaeological investigations, ground condition investigations and intrusive site surveys and other enabling works: site clearance; soil storage; remedial works in respect of any contamination or any other adverse ground conditions; erection of any temporary means of enclosure, land raising and construction of the bridge), details of both hard, soft and water landscape works shall be submitted to and approved in writing by the Local Planning Authority. The works shall then be carried out as approved. Such details to include, where relevant:
-	Soft planting: including any grass and turf areas, trees, planters, shrub and herbaceous areas including details of species, sizes, numbers/densities, spacing and sections of landscaped areas;
-	A 'Tree Planting Statement' providing full details, locations, specifications and construction methods for all purpose-built tree pits and associated above ground features, including specifications for tree protection and a stated volume of suitable growing medium to facilitate and promote the healthy development of the proposed trees, ensuring each tree has a soil volume equivalent of 0.6 times its canopy area at maturity;
-	Hard landscaping: including ground surfaces, kerbs, edges, ridge and flexible paving, furniture, steps, refuse disposal points and if applicable synthetic surfaces for both ground level and roof terrace level (where relevant);
-	Delivery/loading areas associated with each entrance to allow sufficient space for deliveries to be taken at the entrance;
-	Fences and walls and any other boundary treatments, including boundary treatment and visibility splays forming the boundary with the unnamed service road to the rear of the site;
-	Any play spaces and play equipment;
-	Any signage, wayfinding (e.g. Legible London) and information boards;
-	Brown (biodiversity) roofs/green walls (where relevant);
-	Any CCTV equipment;
-	An external lighting strategy

Condition : 40 - Prior to commencement of the development (except demolition, ground condition investigations and intrusive site surveys and other enabling works: site clearance; soil storage; remedial works in respect of any contamination or any other adverse ground conditions; erection of any temporary means of enclosure and land raising) a Biodiversity Enhancement Strategy, in line with the submitted Preliminary Ecological Appraisal, shall be submitted to and approved in writing by the Local Planning Authority. The Biodiversity Enhancement Strategy shall incorporate, where relevant:
-	Biodiverse/Biosolar Green Roofs supporting at least 25 plant species;
-	Native scrub and tree planting;
-	Good horticultural practice;
-	Provision of bat roosting opportunities; and
-	Details of how the enhancement measures will be monitored, managed and maintained as such.
The development shall then be carried out in accordance with the approved details and retained thereafter.
